import { useRef, useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom'; // Import useNavigate from react-router-dom

import './Pricing.css';

const Pricing = () => {

    const navigate = useNavigate(); // Initialize the navigate function

    // Function to handle back navigation
    const goBack = () => {
        navigate(-1); // Navigates to the previous page in the history stack
    };

    const upgradeUser = async (newRole) => {
        try {

            setIsSubmitButtonClicked(prevState => !prevState);
            const updateResponse = await fetch(`http://localhost:3000/api/user/upgradeUser`, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    'User-ID': String(sessionStorage.getItem('userId'))
                },
                body: JSON.stringify({
                    newRole: newRole
                }),

            });
            if (updateResponse.ok) {
                console.log('Payment Finalisation...');
                window.location.href = responseBody.url;              

            } else {
                console.error('Failed during the payment process');
                window.location.href = "http://localhost:3000/payment-error";
            }
        } catch (error) {
            console.error(error);
            window.location.href = "http://localhost:3000/payment-confirmation";
        }
      }  
    

    return (
        <>
            <div className="top-bar">
                <button onClick={goBack} className="back-arrow">←</button>
            </div>
            <div className="pricing-header">
                <h1>Pricing</h1>
                <p className="plan-description">
                    Choisissez le plan qui <span className="underline">vous</span> correspond.
                </p>
            </div>
            <div className="pricing-container">
                <div className="card">
                <div className="card-image truck"></div>
                <div className="card-content">
                    <h2>Occasionnel</h2>
                    <p className="price">15 €</p>
                    <p className="details">- 500 générations</p>
                    <p className="details">Tu as tout ton temps pour les utiliser</p>
                    <button onClick={upgradeUser("PAYASYOUGO")}>Choisir</button>
                </div>
                </div>
                <div className="card">
                <div className="card-image boat"></div>
                <div className="card-content">
                    <h2>Professionnel</h2>
                    <p className="price">20€ /mois</p>
                    <p className="details">- 1000 générations /mois</p>
                    <button onClick={upgradeUser("PREMIUM")}>Choisir</button>
                </div>
                </div>
                <div className="card">
                <div className="card-image plane"></div>
                <div className="card-content">
                    <h2>Vétéran</h2>
                    <p className="price">40€ /mois</p>
                    <p className="details">- Générations illimitées</p>
                    <button onClick={upgradeUser("FULLPREMIUM")}>Choisir</button>
                </div>
                </div>
            </div>
            <div className="faq-section">
            <div className="faq-container">
                <h3>How does the plan limit work?</h3>
                <p>If you go over your limit we'll nicely ask you to upgrade. You can create up to 100 images per week for free.</p>
            </div>
            <div className="faq-container">
                <h3>Can I buy more fast generations?</h3>
                <p>Yes, you can buy fast generations for $0.01 per generation. These never expire, but you must have an active plan to use them.</p>
            </div>
            {/* ...Additional FAQs... */}
            </div>
        </>
    );
  };
  

export default Pricing
